import React from 'react';
import { Link } from 'react-router-dom'
const  Navbar = ()=>{

    return(
        <header>
        <nav className="container navbar">
         <h2 className="site-logo">ULTRA</h2>
         <ul className="nav-lists"> 
           <li>Home</li>
           <li>Work</li>
           <li>Portfolio</li>
           <li>Resume</li>
           <li>About</li>
           <li>Contact</li>
         </ul>
        </nav>
     </header>
    )
}

export default Navbar ;
